import React, { useRef, useState } from "react";
// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";
import "swiper/css/navigation";

import "./styles.css";

// import required modules
import { Autoplay, Navigation } from "swiper/modules";

export default function SwiperCards() {
  return (
    <>
    <div className="container">
      <div className="swiper-wrapper bg-light">
        <Swiper
          navigation={true}
          modules={[Navigation, Autoplay]}
          autoplay={{ delay: 2500 }}
          slidesPerView={3} // Set number of slides per view
          spaceBetween={20}
          className="mySwiper p-2"
        >
          <SwiperSlide className="bg-danger">Slide 1</SwiperSlide>
          <SwiperSlide className="bg-primary">Slide 2</SwiperSlide>
          <SwiperSlide className="bg-secondary">Slide 3</SwiperSlide>
          <SwiperSlide className="bg-success">Slide 4</SwiperSlide>
          <SwiperSlide className="bg-warning">Slide 5</SwiperSlide>
          <SwiperSlide className="bg-info">Slide 6</SwiperSlide>
          <SwiperSlide className="bg-dark">Slide 7</SwiperSlide>
          <SwiperSlide className="bg-light">Slide 8</SwiperSlide>
          <SwiperSlide className="bg-white">Slide 9</SwiperSlide>
        </Swiper>
      </div>
    </div>
    </>
  );
}
